import styled from "styled-components"

const Botao = styled.button`
width: 280px;
height: 48px;
padding: 12px 16px;
justify-content: center;
align-items: center;
border-radius: 8px;
background-color: #0B3B60`


export default function Button(texto: string) {
    return(
        <button>{texto}</button>
    )
}
